import React from "react";
import { styled } from "reakit";

const Wrapper = styled.div`
  display: flex;
  justify-content: center;
  flex-direction: column;
  margin: 100px;
  gap: 20px;
`;

const Profile = (props) => {
  return (
    <Wrapper>
      <label>Name:</label>
    </Wrapper>
  );
};

export default Profile;
